function tranGenerator() {
  return {
    first_tran: {
      date: "06/17/2023",
      description: "food",
      amount: -98.67,
    },
    second_tran: {
      date: "06/22/2023",
      description: "travel",
      amount: -1100,
    },
    third_tran: {
      date: "06/11/2023",
      description: "salary",
      amount: 2000,
    },
  };
}

export default tranGenerator;
